import React from "react";
import "./styles.css"
import hotel from "../../assets/hotels/hotel-1.jpeg"
import StarRateRoundedIcon from '@mui/icons-material/StarRateRounded';
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";
import { Pagination, Navigation } from "swiper";
export default function Card({car}){
    return (

      <div className="card-box">
      <Swiper
        slidesPerView={1}
        spaceBetween={15}
        loop={true}
        mousewheel={true}
        cssMode={true}
        pagination
        modules={[Pagination, Navigation]}
        className="swiper-container"
      >
        {card.imgSrc.map((src, i) => (
          <SwiperSlide key={i}>
            <img src={src} className="card-img" />
          </SwiperSlide>
        ))}
      </Swiper>
        <img src={hotel} className="card-img" alt="" />
        <div className="card-info-flex">
            <h3 className="card-title">place</h3>
            <div className="card-rating"><StarRateRoundedIcon/><p>3.88</p></div>

        </div>
        <p style={{margin:0}}>beach and sea view</p>
        <p style={{margin:0}}>19-25 May</p>
    </div>
    )
}
